import React from "react";
import ReactDOM from "react-dom";
import {add, sub, mul, div} from "./App"
import "./index.css";

ReactDOM.render(
    <>
        <ul>
            <li>sum of two no is {add(60,3)}</li>
            <li>sum of two no is {sub(33,3)}</li>
            <li>sum of two no is {mul(10,6)}</li>
            <li>sum of two no is {div(80,4)}</li>
        </ul>
    </>,
    document.getElementById("root")
);
